import CartWidget from "./CartWidget.jsx";

import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

const NavBar = () => {
    return (
        <header>
            <nav>
                <span>Polimery</span><span>Wolf</span>
                <a href="#">Nosotros</a>
                <a href="#">Contactos</a>
                <a href="#">Store</a>
                <CartWidget/>
            </nav>
        </header>
    );
}

export default NavBar;
